Perpisahan dengan siswa siswi di Thailand oleh para Volunteer kita. People come and go, semoga mereka mendapatkan memori yg saling tak terlupakan selama di bersama-sama

@nursetonugroho21 is one of our volunteer in Vietnam. His project is teaching english in one of the local school. He joins PPL International UNNES for 2 months program. Yesterday was the first day in the school and one of UNNES lecturer had a visit to see the learning process in Vietnamese school

Wish this is gonna be a fruitful experience.

