Ini adalah acara Hungarian International Meel dimana relawan dari Hungaria memasak makanan traditional mereka bersama dengan relawan lainnya di project Le Creneau, Perancis. Jadi para peserta juga belajar tidak hanya memasak makanan Perancis tapi juga makanan tradisional dr negara lainnya.

@ema_nhasanah ini tinggal di volunteer house bersama dengan teman2 volunteer lainnya selama lebih dari 6 bulan. Banyak sekali kenangan yg ga akan terlupakan pastinya.

#IVSmovement #voluntaryservice #volunteeroverseas #volunteerabroad #perancis #france #europe #hungary #indonesia #indorelawan #semaeang #semaranghitz #youthexchange #travelling #travel #adventure #instaporn #instanesia

@yogipanggayuh has finished his mission as an EVS volunteer in the UK of 8 months program. The program is under erasmus+ organized by the ICYE IO concerning communicating human rights. As a peace messenger, he had undergone various social services in a charitable organisation Freshwinds, Birmingham, England. He had gain lots of skills and understanding about what a real life is.

Thank you for the @icyeuk as the hosting organization to support him with some trainings to learn deeper about volunteer role and cross cultural understanding.

#ivs #dejavatofoundation #volunteer  #erasmus #icye #icyevolunteer

